import React, { useEffect , useState} from "react";
import "../../styles/booking-form.css";
import { Form, FormGroup, Button } from "reactstrap";
import axios from "axios";
import { useNavigate } from 'react-router-dom';

const BookingForm = ({ idCar }) => {
  const [rentalDetails, setRentalDetails] = useState({
    userName: '',
    userEmail: '',
    userPhone: '',
    startDate: '',
    endDate: '',
    totalCost: 0,
    luggage: 0,
    status: 'active', // Default status, adjust as necessary
    comment: ''
  });

  const navigate = useNavigate();

  const handleInputChange = (e) => {
    setRentalDetails({ ...rentalDetails, [e.target.name]: e.target.value });
  };


  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:3000/rentals', { ...rentalDetails, idCar });
      navigate('/'); // Redirect to home
    } catch (error) {
      console.error('Error creating rental:', error);
      alert('Failed to create rental');
    }
  };

  return (
    <Form onSubmit={handleSubmit}>
      <FormGroup className="booking__form d-inline-block me-4 mb-4">
        <input type="text" name="userName" placeholder="Name" value={rentalDetails.userName} onChange={handleInputChange}/>
      </FormGroup>

      <FormGroup className="booking__form d-inline-block me-4 mb-4">
        <input type="email" name="userEmail" placeholder="Email" value={rentalDetails.userEmail} onChange={handleInputChange}/>
      </FormGroup>
      <FormGroup className="booking__form d-inline-block ms-1 mb-4">
        <input type="number" name="userName" placeholder="Phone Number" value={rentalDetails.userPhone} onChange={handleInputChange}/>
      </FormGroup>

      <FormGroup className="booking__form d-inline-block me-4 mb-4">
        <select name="" id="">
          <option value="1 person">1 Person</option>
          <option value="2 person">2 Person</option>
          <option value="3 person">3 Person</option>
          <option value="4 person">4 Person</option>
          <option value="5+ person">5+ Person</option>
        </select>
      </FormGroup>
      <FormGroup className="booking__form d-inline-block ms-1 mb-4">
        <select name="luggage" id="" value={rentalDetails.luggage} onChange={handleInputChange}>
          <option value="1">1 luggage</option>
          <option value="2">2 luggage</option>
          <option value="3">3 luggage</option>
          <option value="4">4 luggage</option>
          <option value="5">5+ luggage</option>
        </select>
      </FormGroup>

      <FormGroup className="booking__form d-inline-block me-4 mb-4">
        <input type="date" placeholder="Start Date" value={rentalDetails.startDate} onChange={handleInputChange}/>
      </FormGroup>
      <FormGroup className="booking__form d-inline-block ms-1 mb-4">
        <input type="date" placeholder="End Date" value={rentalDetails.endDate} onChange={handleInputChange}/>
      </FormGroup>

      <FormGroup>
        <textarea
          rows={5}
          type="textarea"
          className="textarea"
          placeholder="Write"
          value={rentalDetails.comment} 
          onChange={handleInputChange}
        ></textarea>
      </FormGroup>

      <Button className="w-50" type="submit" variant="primary">Submit</Button>
    </Form>
  );
};

export default BookingForm;
